// Directory to store downloaded images
const downloadDirectory = "image_downloads";

// Ensure the download directory exists
if (!fs.existsSync(downloadDirectory)) {
    fs.mkdirSync(downloadDirectory);
}

// Download images
async function downloadImages() {
    for (let i = 500; i <= imageUrls.length; i++) {
        try {
            const response = await fetch(imageUrls[i], { responseType: 'stream' });
            const filename = path.join(downloadDirectory, `image_${i + 1}.jpg`);
            const writer = fs.createWriteStream(filename);
            response.data.pipe(writer);

            await new Promise((resolve, reject) => {
                writer.on('finish', resolve);
                writer.on('error', reject);
            });

            console.log(`Image ${i + 1} downloaded successfully.`);
        } catch (error) {
            console.error(`Failed to download image ${i + 1}. Error: ${error.message}`);
        }
    }
}

downloadImages();
